import { AppBar, Toolbar } from '@mui/material';
import { useSpring, animated, useScroll, useInView} from '@react-spring/web';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
    Link,
    Grid,
  } from "@mui/material";
  import image1 from './images/image1.png';
  import image2 from './images/image2.png';
  import image4 from './images/image4.png';
  import image5 from './images/image5.png';

  import video1 from './videos/video1.gif';
  import video2 from './videos/video2.gif';
  import video3 from './videos/video3.gif';

  import List from "./List";

  const itemData = [
    {
      img: image1,
      desc: 'biggest size maze as a 30x30',
    },
    {
      img: image2,
      desc: 'After the computer found the solution',
    },
    {
      img: image4,
      desc: 'the medium sized maze at 20x20',
    },
    {
      img: image5,
      desc: 'the second colour pallet option',
    }];

  const videoData = [
    {
      img: video1,
      desc: 'the computer finding the solution',
    },{
      img: video2,
      desc: 'changing colour pallets',
    },
    {
      img: video3,
      desc: 'changing the sizes of maze and layout',
    }
  ];

  function MazeGame() {

    const [ref1, inView1] = useInView();
    const [ref2, inView2] = useInView();

    const show = useSpring({
      from: { opacity: 0 },
      to: { opacity: inView1 ? 1 : 0 },
      config: { duration: 2000 },
    });
    const show2 = useSpring({
      from: { opacity: 0 },
      to: { opacity: inView2 ? 1 : 0 },
      config: { duration: 2000 },
    });
    return (
      <>
      <h1>MAZE GAME</h1>
      <Typography >
            Using the SDL library with C++ i was able to design and develop a maze game. This maze game allows you to regenerate
            a new maze with just a click of a button. There are 3 maze sizes to choose from, a 12x12 a 20x20 and a 30x30 maze size.
            In addition you change the colour pallet from a blue/white layout to a green/black one. Lastly, if you get stuck you can 
            click the "solve" button and the computer will show you how to complete the maze! If you want to look at how the program 
            looks like you can check out the screenshots and gifs below.
          </Typography>
          <Link href="https://github.com/TheRealJasoandRazi/mewed" target="_blank" rel="noopener noreferrer">
            Source Code Here
          </Link>
      <Stack spacing={2} direction="row" style={{ width: '100%', height: '100%' }}>
        <Stack spacing={10}>
          <animated.div
            ref={ref1}
            style={{
              width: '100%',
              height: '100%',
              margin: '10%',
              background: '#ff6d6d',
              borderRadius: 8,
              ...show,
              alignContent: 'center',
              textAlign: 'center',
              overflow: 'hidden',
            }}
          >
            <img
              src={image1} 
              alt="My Projects Image"
              style={{
                width: '100%', 
                height: '100%',
                objectFit: 'cover',
              }}
            />
          </animated.div>
          <animated.div
            ref={ref2}
            style={{
              width: '100%',
              height: '100%',
              margin: '10%',
              background: '#ff6d6d',
              borderRadius: 8,
              ...show2,
              alignContent: 'center',
              textAlign: 'center',
              overflow: 'hidden',
            }}
          >
            <img
              src={image2} 
              alt="My Projects Image"
              style={{
                width: '100%', 
                height: '100%',
                objectFit: 'cover',
              }}
            />
          </animated.div>
        </Stack>
        <Stack spacing={10}>
          <animated.div
              ref={ref1}
              style={{
                width: '100%',
                height: '100%',
                margin: '10%',
                background: '#ff6d6d',
                borderRadius: 8,
                ...show,
                alignContent: 'center',
                textAlign: 'center',
                overflow: 'hidden',
              }}
            >
              <img
                src={image4} 
                alt="My Projects Image"
                style={{
                  width: '100%', 
                  height: '100%',
                  objectFit: 'cover',
                }}
              />
            </animated.div>
            <animated.div
            ref={ref2}
            style={{
              width: '100%',
              height: '100%',
              margin: '10%',
              background: '#ff6d6d',
              borderRadius: 8,
              ...show2,
              alignContent: 'center',
              textAlign: 'center',
              overflow: 'hidden',
            }}
          >
            <img
              src={image5} 
              alt="My Projects Image"
              style={{
                width: '100%', 
                height: '100%',
                objectFit: 'cover',
              }}
            />
          </animated.div>
        </Stack>
      </Stack>
      </>
